script: |
  super -f text -I q89.spq | sort > q89.out

inputs:
  - name: q89.spq
    data: |
      SELECT DISTINCT CAST ( NULL AS INTEGER ) FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 BETWEEN ( + col2 - 89 - - col2 + col0 * col0 * + - col0 ) AND NULL;
  - name: tab1

outputs:
  - name: q89.out
    data: |
